VALUES ('3528161506058', '6 cônes fruits rouges', 'Sorbet fraises et framboises (35,6 %) : purée de fraises (25 %), eau, sucre, jus de fraises à base de concentré (13,8 %), sirop de glucose de blé, purée de framboises (9 %), jus de framboises à base de concentré (6,4 %), stabilisants : gomme xanthane - gomme guar, protéines de pois hydrolysées, jus concentré de carottes pourpres, arôme naturel, colorant : caroténoïdes. Sorbet cassis (35,6 %) : eau, purée de cassis (22,5 %), sucre, jus de cassis à base de concentré (18,6 %), sirop de glucose de blé, arôme naturel de cassis, stabilisants : gomme xanthane - gomme guar, protéines de pois hydrolysées, acidifiant : acide citrique. Cornet biscuit (16,7 %) : farine de _blé_, sucre, matière grasse végétale de noix de coco non hydrogénée, émulsifiant : lécithine de _soja_, colorant : caramel ordinaire, poudre à lever : carbonates de magnésium. Enrobage au cacao maigre (7,6 %) : matière grasse végétale de noix de coco non hydrogénée, sucre, cacao maigre en poudre (11 %), huile végétale de colza non hydrogénée, émulsifiant : lécithine de _soja_. Sauce aux fruits rouges (4,5 %) : sirop de glucose-fructose de blé et/ou maïs, purée de fruits rouges (30 %) (fraises, framboises, groseilles), sucre, eau, amidon transformé de maïs, colorant : anthocyanes (contient _sulfites_), acidifiant : acide citrique, arôme naturel, arôme naturel de framboises.', '', '4.9', '3.7', '38.7', '26.7', '1.4', '1.4', '0.01', '0.00393700787401575', '', '0');

